(27, 1, 1, 'TE-ATO', 'delivery@te-ato.com', 'delivery@te-ato.com', '20 Fevereiro - A Farsa do Mestre Pathelin em cena', NULL, '***************************\r\nA Farsa do Mestre Pathelin\r\n***************************\r\n\r\nVersão da web ( http://[webversion] )\r\n\r\n--------------------------------------\r\nEm exibição - 20.Fev.2015, ..., 21:30\r\n--------------------------------------\r\n\r\nFoto da representação da Farsa do Mestre Pathelin\r\n( http://www.te-ato.com/espetculos/farsa-do-mestre-pathelin/ )\r\n\r\nSala Jaime Salazar Sampaio (TE-ATO), Leiria\r\n-------------------------------------------\r\n\r\nPrómixo espetáculo: 20.Fev.2015, pelas\r\n21:30.\r\n\r\nDepois, todas as 3ª-feiras e\r\n6ª-feiras, à mesma hora.\r\n\r\nIngresso: 5,00€\r\n\r\nM/5 - Crianças\r\n\r\nFicaríamos muito gratos pela divulgação na\r\nsua empresa/instituição.\r\n\r\nSabe que o espetáculo poderá ser exibido na\r\nsua instituição ou eventos? Contate-nos!\r\n\r\nTE-ATO (Grupo-Teatro de Leiria)\r\n\r\nSala Jaime Salazar Sampaio\r\n\r\nRua Pedro Nunes 15-A\r\nLeiria 2401-206 Leiria\r\n\r\nPortugal\r\n\r\nContactos: 962 904 385 | www.te-ato.com ( http://www.te-ato.com ) | facebook ( https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?ref=hl ) | facebook ( https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?ref=hl )2 ( https://www.facebook.com/teato.leiria?fref=ts ) | Mapa\r\nlocalização ( https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0 )\r\n\r\nO TE-ATO é uma Companhia de Teatro Independente\r\ne não-subsidiada que conta com o apoio à produção da Câmara\r\nMunicipal de Leiria, Fundação Caixa Agrícola de Leiria e da\r\nLivraria ARQUIVO.\r\n\r\nEsta mensagem foi enviada para: [Email]\r\n\r\nPara remover a sua subscrição use o link remover\r\nsubscrição ( http://[unsubscribe] ).', '<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8" /><meta name="viewport" con