(31, 1, 1, 'TE-ATO', 'delivery@te-ato.com', 'delivery@te-ato.com', 'Seja Amigo e assista gratuitamente à Farsa do Mestre Pathelin', 'Campanha Amizade e Pathelin, Abril 2015', 'Campanha Amizade\r\n\r\nTorne-se Amigo e Traga um Amigo.\r\n\r\nTorne-se amigo do ( https://www.facebook.com/teato.leiria?fref=ts )TE-ATO ( https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112 ), faça um Like na página TE-ATO ( https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112 ) ou subscreva a nossa Newsletter ( http://www.te-ato.com/divulgacao/subscrever-newsletter-do-te-ato/ ), e serão nossos convidados para assistirem a esta hilariante\r\npeça, você e um(a) sua amigo(a). Gratuitamente.\r\n\r\nOferta também válida para os Amigos Atuais e\r\nSubscritores da nossa Neswsletter.\r\n\r\n&\r\n\r\nA Farsa do Mestre Pathelin, M/5\r\n\r\nEspetáculos: dias 14, 17 e 21 de Abril, 21h30m\r\n\r\nFicaríamos muito gratos pela divulgação na sua\r\nempresa/instituição.\r\n\r\nSabia que o espetáculo poderá ser exibido na sua\r\ninstituição ou eventos? Contacte-nos!\r\n\r\nContactos: 962 904 385 | www.te-ato.com ( http://www.te-ato.com ) | facebook ( http://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?ref=hl ) | Mapa localização ( https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0 )\r\n\r\nO TE-ATO é uma Companhia de Teatro Independente e não-subsidiada\r\nque conta com o apoio à produção da Câmara Municipal de Leiria,\r\nFundação Caixa Agrícola de Leiria e da Livraria ARQUIVO.\r\n\r\nVer a newsletter na web ( %5Bwebversion%5D )\r\nEsta mensagem foi enviada para: [Email]\r\nPor favor use o link para remover subscrição ( %5Bunsubscribe%5D\r\n) da nossa newsletter.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head><meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta name="viewport" conte