(33, 1, 1, 'TE-ATO', 'delivery@te-ato.com', 'delivery@te-ato.com', 'Sinopse, 2ª Mostra de Peças de Teatro de Curta Duração, 30 Maio 2015', 'Sinopse, 30 Maio 2015, 1 emailing', 'SINOPSE - 2ª mostra de peças de curta duração\r\n\r\nConvite para apresentação de trabalhos para\r\nindivíduos ou grupos amadores\r\n\r\nVeja a informação anexa\r\n-----------------------\r\n\r\nCandidaturas até 20 de Maio\r\n\r\nFicaríamos muito gratos pela divulgação na sua\r\nempresa/instituição.\r\n\r\nSabia que o espetáculo poderá ser exibido na sua\r\ninstituição ou eventos? Contacte-nos!\r\n\r\nContactos: 962 904 385 | www.te-ato.com ( http://www.te-ato.com ) | facebook ( http://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?ref=hl ) | Mapa localização ( https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0 )\r\n\r\nO TE-ATO é uma Companhia de Teatro Independente e não-subsidiada\r\nque conta com o apoio à produção da Câmara Municipal de Leiria,\r\nFundação Caixa Agrícola de Leiria e da Livraria ARQUIVO.\r\n\r\nVer a newsletter na web ( %5Bwebversion%5D )\r\nEsta mensagem foi enviada para: [Email]\r\nPor favor use o link para remover subscrição ( %5Bunsubscribe%5D\r\n) da nossa newsletter.', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head><meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta name="viewport" content="width=device-width" />\r\n	<title>My email message created with BeeFree</title>\r\n	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta name="viewport" content="width=device-width, initial-scale=1.0" /><meta http-equiv="X-UA-Compatible" content="IE=edge" /><meta name="format-detection" content="telephone=no" />\r\n</head>\r\n<body bgcolor="#000000" style="width: 100% !important; -webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%; mso-line-height-rule: exactly; margin: 0; pa