(43, 1, 1, 'TE-ATO', 'delivery@te-ato.com', 'delivery@te-ato.com', 'Assista à Sinopse, 2ª Mostra de Peças de Teatro de Curta Duração, 30 Maio 2015', 'Sinopse, 30 Maio 2015, 3c emailing', 'SINOPSE - 2ª mostra de peças de teatro de curta\r\nduração\r\n\r\nPrograma\r\n\r\nHORA\r\nTÍTULO\r\nGRUPO\r\n\r\n15h00\r\nO DIA DA ANGUS TIA\r\n\r\nAutor: Dizpersão\r\n\r\nEncenação: Dizpersão\r\nDIZPERSÃO\r\n\r\nColectivo de Teatro\r\n\r\n16h00\r\nGOTA DE MEL\r\n\r\nAutor: Léon de Chancerel\r\n\r\nEncenação: Norberto Barroca\r\nSPORT OPERÁRIO MARINHENSE\r\n\r\n17h00\r\n\r\nIMPULSOS II\r\n\r\nAutor e encenador: Pedro Oliveira\r\n\r\n(a partir de textos a seu gosto)\r\n\r\n+16 anos\r\n\r\nO NARIZ\r\n\r\nTeatro de Grupo\r\n\r\n19h30\r\nJANTAR\r\n\r\n21h30\r\n\r\nOS OUTROS e BATALHA NAVAL\r\n\r\nAutor: Jaime Salazar Sampaio\r\n\r\nEncenação: Luís Paniágua\r\n\r\nTIL – Teatro Independente de Loures\r\n\r\n22h00\r\n\r\nINTERVENÇÃO SOBRE O ESTADO DA CULTURA\r\n\r\nProfessor Doutor Pedro Pita\r\n\r\n23h00\r\n\r\nSESSÃO DE ENCERRAMENTO\r\n\r\nDelegado do INATEL em Leiria\r\n\r\nVereador do Pelouro da Cultura da CML\r\n\r\nDiretor Artístico do TE-ATO\r\n\r\nFicaríamos muito gratos pela divulgação na sua\r\nempresa/instituição.\r\n\r\nSabia que o espetáculo poderá ser exibido na sua\r\ninstituição ou eventos? Contacte-nos!\r\n\r\nContactos: 962 904 385 | www.te-ato.com ( http://www.te-ato.com ) | facebook ( http://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?ref=hl ) | Mapa localização ( https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0 )\r\n\r\nO TE-ATO é uma Companhia de Teatro Independente e não-subsidiada\r\nque conta com o apoio à produção da Câmara Municipal de Leiria,\r\nFundação Caixa Agrícola de Leiria e da Livraria ARQUIVO.\r\n\r\nVer a newsletter na web ( %5Bwebversion%5D )\r\nEsta mensagem foi enviada para: [Email]\r\nPor favor use o link para remover subscrição ( %5Bunsubscribe%5D\r\n) da nossa newsletter.\r\n\r\nPara subscrever ( http://www.te-ato.com/divulgacao/subscrever-newsletter-do-te-ato/ ) a nossa newletter', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Strict//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-strict.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head><meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta name="viewport" content="width=device-width" />\r\n	<title>My email message created with BeeFree</title>\r\n	<meta http-equiv="Content-Type" content="text/html; charset=utf-8" /><meta name="viewport" content="width=device-width, initial-scale=1.0" /><meta http-equiv="X-UA-Compatible" content="IE=edge" /><meta name="format-detection" content="telephone=no" />\r\n</head>\r\n<body bgcolor="#000000" style="width: 100% !important; -webkit-text-size-adjust: 100%; -ms-text-size-adjust: 100%; mso-line-height-rule: exactly; margin: 0; padding: 0;">\r\n<table align="center" bgcolor="#000000" border="0" cellpadding="0" cellspacing="0" style="text-align: center; border-collapse: collapse; max-width: 480px !important; background-color: #000000;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td align="center" style="border-collapse: collapse;">&nbsp;\r\n			<table border="0" cellpadding="0" cellspacing="0">\r\n				<tbody>\r\n					<tr>\r\n						<td style="border-collapse: collapse;">\r\n						<table bgcolor="#000000" border="0" cellpadding="0" cellspacing="0" style="border-collapse: collapse; min-width: 320px !important; width: 100% !important;" width="600">\r\n							<tbody>\r\n								<tr>\r\n									<td bgcolor="#000000">\r\n									<table bgcolor="#000000" border="0" cellpadding="10" cellspacing="0" style="border-collapse: collapse; background-color: rgb(0, 0, 0);" width="100%">\r\n										<tbody>\r\n											<tr valign="top">\r\n												<td align="left" height="2" style="border-collapse: collapse;" valign="top">\r\n												<table align="center" bgcolor="#000000" border="0" cellpadding="0" cellspacing="0" style="border-top-width: 1px; border-top-style: