(1, 1, 1, 'Lista de emails do MK', 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL, 1, NULL, 0, 0, 0),
(2, 1, 1, 'emails do MC', 0, NULL, NULL, NULL, 0, NULL, NULL, 0, NULL, NULL, NULL, NULL, 1, NULL, 0, 0, 0),
(3, 1, 1, 'TE-ATO - Notícias e Eventos', 1, 'http://emkt.eu/sendy/brands/te-ato/te-ato-subscription-success-landing-page.html', 'http://emkt.eu/sendy/brands/te-ato/te-ato-pre-subscription-landing-page.html', 'http://emkt.eu/sendy/brands/te-ato/te-ato-unsubscribe-landing-page.html', 1, 'TE-ATO - Boas-vindas - confirmação de subscrição', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Caro/a Amigo/a,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Eacute; com enorme satisfa&ccedil;&atilde;o que o/a podemos contar como membro da&nbsp;lista de divulga&ccedil;&atilde;o das ativididades do&nbsp;projeto cultural e art&iacute;stico do TE-ATO.</p>\r\n\r\n<p>Convidamo-lo/a desde j&aacute; a participar nas nossas atividades e, querendo, a conhecer-nos melhor visitando-nos&nbsp;na nossa sala de espet&aacute;culos&nbsp;&agrave;s 3&ordf;-feira e 5&ordf;-feira, entre as 21h30m&nbsp;e as 23h30m (salvo excep&ccedil;&otilde;es),&nbsp;dias em que o grupo se encontra para ensaios e outros trabalhos.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Com as melhores sauda&ccedil;&otilde;es.</p>\r\n\r\n<p>TE-ATO (Grupo Teatro de Leiria)</p>\r\n\r\n<p><span style="font-size: 10px;">Tamb&eacute;m pode seguirnos atrav&eacute;s do nosso novo site e contas do facebook.</span></p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" summary="Contatos e localização do TE-ATO">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="Logotipo do TE-ATO" src="http://emkt.eu/sendy/uploads/1417802439.jpg" style="width: 75px; height: 77px;" /></td>\r\n			<td><span style="font-size: 11px;">TE-ATO (Sala Jaime Salazar Sampaio)<br />\r\n			Rua Pedro Nunes 15A<br />\r\n			2400-206 Leiria<br />\r\n			(ao Arquivo Distrital/Terreiro)<br />\r\n			<a href="https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0" target="_blank">Mapa de localiza&ccedil;&atilde;o</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="http://www.te-ato.com">http://www.te-ato.com</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/teato.leiria?fref=ts">https://www.facebook.com/teato.leiria?fref=ts</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts">https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts</a></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</body>\r\n</html>\r\n', 1, 'TE-ATO - Lembranças na despedida.', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Caro Amigo/a,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Obrigado por ter estado connosco.</p>\r\n\r\n<p>Esperamos voltar a reencontrarmo-nos em breve.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Votos de felicidades e os nossos cumprimentos.</p>\r\n\r\n<p>TE-ATO (Grupo Teatro de Leiria)</p>\r\n\r\n<p><span style="font-size: 10px;">Tamb&eacute;m pode seguirnos atrav&eacute;s do nosso novo site e contas do facebook.</span></p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" summary="Contatos e localização do TE-ATO">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="Logotipo do TE-ATO" src="http://emkt.eu/sendy/uploads/1417802439.jpg" style="width: 75px; height: 77px;" /></td>\r\n			<td><span style="font-size: 11px;">TE-ATO (Sala Jaime Salazar Sampaio)<br />\r\n			Rua Pedro Nunes 15A<br />\r\n			2400-206 Leiria<br />\r\n			(ao Arquivo Distrital/Terreiro)<br />\r\n			<a href="https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0" target="_blank">Mapa de localiza&ccedil;&atilde;o</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="http://www.te-ato.com">http://www.te-ato.com</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/teato.leiria?fref=ts">https://www.facebook.com/teato.leiria?fref=ts</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts">https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts</a></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', 'TE-ATO Seja bem vindo/a. Confirmar subscrição.', '<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Caro/a Amigo/a,</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Obrigdo pelo interesse e seja muito bem vindo/a.</p>\r\n\r\n<p>Apenas tem de confirmar&nbsp;a sua subscri&ccedil;&atilde;o na nossa lista de divulga&ccedil;&atilde;o visitando&nbsp;o link abaixo:</p>\r\n\r\n<p><a href="[confirmation_link]"><span style="color:#000080;"><span style="font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; font-size: 12px; line-height: 18px; background-color: rgb(249, 249, 249);">[confirmation_link]</span></span></a></p>\r\n\r\n<p><span style="color:#000080;"><span style="font-size:10px;"><span style="font-family: Menlo, Monaco, Consolas, ''Courier New'', monospace; line-height: 18px;">Nota: o TE-ATO usa os servi&ccedil;os de emailing da emkt.eu, raz&atilde;o pela qual aparece no link anterior.</span></span></span></p>\r\n\r\n<p>Se n&atilde;o confirmar o seu interesse visitando o link, a subscri&ccedil;&atilde;o ficar&aacute; sem efeito.</p>\r\n\r\n<p>De outro modo, receber&aacute; um outro email de boas vindas.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Os nosos agradecimentos,</p>\r\n\r\n<p>TE-ATO (Grupo Teatro de Leiria)</p>\r\n\r\n<p><span style="font-size: 10px;">Tamb&eacute;m pode seguirnos atrav&eacute;s do nosso novo site e contas do facebook.</span></p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" summary="Contatos e localização do TE-ATO">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt="Logotipo do TE-ATO" src="http://emkt.eu/sendy/uploads/1417802439.jpg" style="width: 75px; height: 77px;" /></td>\r\n			<td><span style="font-size: 11px;">TE-ATO (Sala Jaime Salazar Sampaio)<br />\r\n			Rua Pedro Nunes 15A<br />\r\n			2400-206 Leiria<br />\r\n			(ao Arquivo Distrital/Terreiro)<br />\r\n			<a href="https://www.google.com/maps/d/edit?mid=z5Gk-WIDzU2U.kxEypVXLCdL0" target="_blank">Mapa de localiza&ccedil;&atilde;o</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="http://www.te-ato.com">http://www.te-ato.com</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/teato.leiria?fref=ts">https://www.facebook.com/teato.leiria?fref=ts</a></span></td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td><span style="font-size: 11px;"><a href="https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts">https://www.facebook.com/pages/Te-Ato-Grupo-Teatro-de-Leiria/185475751530112?fref=ts</a></span><br />\r\n			&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>\r\n', 1, 'Sexo:Text%s%Local:Text%s%Interesses:Text%s%Resp. Teatro/Associacoes:Text', 0, 0, 0),
